private BigFraction minor(final BigFraction[] c1, final BigFraction[] c2){
    return c2[0].multiply(c1[2].subtract(c1[1])).add(c2[1].multiply(c1[0].subtract(c1[2]))).add(c2[2].multiply(c1[1].subtract(c1[0])));
}

